import productList from "./productList";
import React, { useState } from "react";

const App = () => {
	const [filteredProductList, setFilteredProductList] = useState(productList);

	const [filterName, setFilterName] = useState("");
	const [filterCategory, setFilterCategory] = useState("");
	const [filterPrice, setFilterPrice] = useState("");

	const randomItem = Math.floor(Math.random() * filteredProductList.length);
	const promotedProduct = productList[randomItem];
	promotedProduct.newPrice = Math.round(parseInt(promotedProduct.price.substring(1)) / 2);
	const today = new Date();
	const monthNames = [
		"January",
		"February",
		"March",
		"April",
		"May",
		"June",
		"July",
		"August",
		"September",
		"October",
		"November",
		"December",
	];
	const monthName = monthNames[today.getMonth()];
	const formatedDate = `${today.getDate()} ${monthName}`;

	// const categories = [];
	// productList.forEach((product) => {
	// 	if (!categories.includes(product.category)) {
	// 		categories.push(product.category);
	// 	}
	// });
	// categories.sort();
	// console.log(categories);

	function filterProducts() {}

	return (
		<>
			<section className="filter">
				<div className="container">
					<input type="text" onChange={(event) => setFilterName(event.target.value)} placeholder="Product name" />

					<select></select>

					<input type="number" min="0" step="10" placeholder="Price under..." />

					<button className="btn">Reset all filters</button>

					<div>Total bought items: </div>
				</div>
			</section>

			<section className="promotion">
				<h2>Don't miss today's hot deal!</h2>

				<div className="card">
					<div className="card-image">
						<img src={promotedProduct.image} alt={promotedProduct.name} />
					</div>
					<div className="card-body">
						<h3>{promotedProduct.name}</h3>
						<p>{promotedProduct.shortDescription}</p>
						<p className="old-price">{promotedProduct.price}</p>
						<p>
							<span>${promotedProduct.newPrice}</span> only on <span>{formatedDate}</span>
						</p>
						<a href="#" className="btn">
							Buy now
						</a>
					</div>
				</div>
			</section>

			<section className="products">
				{filteredProductList.map((product, index) => (
					<div className="card">
						<div className="card-image">
							<img key={index} src={product.image} alt={product.name} />
						</div>
						<div className="card-body">
							<h3>{product.name}</h3>
							<p>{product.description}</p>
							<p className="price">{product.price}</p>
							<a href="#" className="btn">
								Add to cart
							</a>
						</div>
					</div>
				))}
			</section>

			<footer>
				<p>
					We bring you <strong>only the best products</strong> that can be randomly generated!
				</p>
				<p>
					Content from <a href="https://marak.github.io/faker.js/">faker.js</a> with images from{" "}
					<a href="https://picsum.photos/">Lorem Picsum</a>
				</p>
			</footer>
		</>
	);
};

export default App;
